import React  from 'react';
import { Form as RSForm } from 'reactstrap';
import {withScroll} from '../Base.js'

class IForm extends React.Component {

  render() {
    let {
      ...attributes
    } = this.props;

    const form = (
      <RSForm
        {...attributes}
      >
        {attributes.children}
      </RSForm>
    );

    return withScroll(form)();
  }
}

IForm.displayName = 'IForm';

export default IForm;
